import React from 'react'
import { Link } from 'react-router-dom';

const Render = () => {
    return (
        <div className='relative'>
            <div className='ring-1 ring-gray-300 bg-white fixed w-full inline-flex justify-end p-3'>
                <div className='items-start mr-auto font-bold text-2xl'>Irrational Investors</div>
                <Link to="/create" className='items-start cursor-pointer bg-indigo-800 text-white font-semibold text-center rounded px-3 py-2'>Create</Link>
            </div>
            <div className='h-16'></div>
        </div>
    )
}

export default Render
